import { createServer } from 'miragejs';
export default function setUpSever() {
  createServer({
    routes() {
      this.get('/api/reminders', () => ({
        reminders: [
          {
            status: 'test',
            date: '2023-04-22T12:30:45.000Z',
          },
        ],
      }));
    },
  });
}
